subir a lo largo de ese recorrido. Paradas principalmente en avenidas)</span></p> <p class="MsoListParagraphCxSpLast" style="margin: 6pt 0cm; line-height: normal;"><span style="font-family: &quot;Verdana&quot;,&quot;sans-serif&quot;;">Grupo Plaza &ndash; L&iacute;nea 129: salida desde plaza frente a Retiro, viaja por 9 de Julio desde Santa Fe hasta Plaza Constituci&oacute;n (Se puede subir a lo largo de ese recorrido. Paradas principalmente en avenidas)</span></p><p class="MsoListParagraph" style="margin: 6pt 0cm; line-height: normal;">&nbsp;</p><p class="MsoListParagraph" style="margin: 6pt 0cm; line-height: normal;">ALOJAMIENTO</p><p class="MsoListParagraph" style="margin: 6pt 0cm; line-height: normal;"><span style="font-size: 11pt; line-height: 115%; font-family: &quot;Verdana&quot;,&quot;sans-serif&quot;;">El siguiente archivo contiene datos de Hoteles 4 y 3 estrellas donde hospedarse en La Plata, con costos desde $149.</span></p>',
