  'introduction' => 
  array (
    'es_ES' => '<p><span style="font-size: x-small; font-family: Arial;"><span style="font-size: 10pt;  font-family: Arial;">El DERECHO CONTABLE es una <span>interdisciplina</span> que tiene por objeto estudiar las relaciones e influencias rec&iacute;procas  entre el DERECHO y la CONTABILIDAD.</span></span></p><p><span style="font-size:  x-small; font-family: Arial;"><span style="font-size: 10pt; font-family: Arial;">Comprende  tanto la regulaci&oacute;n legal de la informaci&oacute;n y pr&aacute;cticas contables como  los efectos de &eacute;stas sobre las relaciones jur&iacute;dicas.</span></span></p><p class="MsoNormal"><span style="font-size: x-small; font-family: Arial;"><span style="font-size: 10pt;  font-family: Arial;">Sus principales &aacute;reas de aplicaci&oacute;n son la  PROCESAL (actuaci&oacute;n de peritos contadores y valor probatorio de las <span>registraciones</span>),  la SOCIETARIA (actuaci&oacute;n de s&iacute;ndicos, informaci&oacute;n societaria y r&eacute;gimen  patrimonial) y la CONCURSAL (actuaci&oacute;n de s&iacute;ndicos e informaci&oacute;n <span>concursal</span>).</span></span></p><p class="MsoNormal"><strong><span style="font-size: x-small; font-family: Arial;"><span style="font-size: 10pt;  font-family: Arial;">EXPOSITORES:</span></span></strong></p><p class="MsoNormal"><strong></strong></p><p class="MsoNormal"><strong> <p align="center"><!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:TrackMoves /> <w:TrackFormatting /> <w:HyphenationZone>21</w:HyphenationZone> <w:PunctuationKerning /> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMixedContent>false</w:IgnoreMixedContent> <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText> <w:DoNotPromoteQF /> <w:LidThemeOther>ES-AR</w:LidThemeOther> <w:LidThemeAsian>X-NONE</w:LidThemeAsian> <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript> <w:Compatibility> <w:BreakWrappedTables /> <w:SnapToGridInCell 