  array (
    'es_ES' => '<p>Las ponencias deber&aacute;n ser presentadas en formato .doc (Microsoft   Word).</p><p>Deber&aacute; consignarse en una car&aacute;tula que comprender&aacute; la   primer p&aacute;gina del archivo .doc:<br />(1) N&uacute;mero y nombre del Tema al que   corresponda la ponencia, seg&uacute;n el Temario de la Jornada (as&iacute; como del  sub-tema, si corresponde); <br />(2)  Nombre y apellido del autor o  autores, direcci&oacute;n y c&oacute;digo postal,  tel&eacute;fono y direcci&oacute;n de correo  electr&oacute;nico;<br />(3) T&iacute;tulo que  identifique el trabajo.<br />(4) Un  resumen de la propuesta de no m&aacute;s de 200 palabras.</p><p>Las  citas  bibliogr&aacute;ficas se incorporar&aacute;n directamente al texto: (Apellido,  a&ntilde;o)  en caso de citar p&aacute;gina/s (Apellido, a&ntilde;o: #-#), en letra normal (no   versales ni todo en may&uacute;sculas). Ejemplo: (Fowler Newton, 2009:   195-196). Las citas har&aacute;n referencia a la Bibliograf&iacute;a, incorporada al   final del cuerpo principal de la ponencia.</p>El desarrollo de la   ponencia no podr&aacute; exceder de siete (7) p&aacute;ginas a simple espacio,   incluidas citas, notas y bibliograf&iacute;a, en papel de tama&ntilde;o A4 con los  m&aacute;rgenes predeterminados de Word (Superior: 2,5; inferior: 2,5;  izquierdo: 3 y derecho: 3 cms), fuente Times New Rom&aacute;n, cuerpo  12,  interlineado sencillo. De modo que con la car&aacute;tula inicial el  trabajo  no podr&aacute; exceder de ocho (8) p&aacute;ginas.<p>Las ponencias deber&aacute;n  versar  sobre los temas inclu&iacute;dos en el Temario de la Jornada. Sin  embargo, los  autores podr&aacute;n presentar ponencias que consideren inclu&iacute;das  en los  temas principales del Temario pero que no entiendan clara su  inclusi&oacute;n  en los sub-temas del mismo.</p><p>En todos los casos la  Comisi&oacute;n  Organizadora podr&aacute; excluir, y disponer que no sean tratados,  las  ponencias que no se ajusten a su juicio al temario o a los objetivos  de  la Jornada o incluirlos si los considera pertinentes.</p><p>Los autores  retienen el copyright de sus trabajos,  y autorizan a la  organizaci&oacute;n  de la Jornada  a  que sus trabajos se publiquen con la  licencia <a href="http://creativecommons.org/licenses/by-nc-sa/2.5/ar/" target="_blank">Creative Commons Atribuci&oacute;n-No Comercial-Compartir Obras   Derivadas Igual 2.5 Argentina</a>, que permite a terceros el libre   acceso a los ficheros, usar y compartir los trabajos, con el   reconocimiento de la autor&iacute;a y como primer punto de referencia de su   presentaci&oacute;n,  esta Jornada.</p><p>Tambi&eacute;n podr&aacute;n  presentarse  comunicaciones de car&aacute;cter informativo sobre cuestiones  emp&iacute;ricas o  pr&aacute;cticas o sobre materias novedosas o de derecho comparado,  vinculados  con el temario de la Jornada. Su admisi&oacute;n y/o publicaci&oacute;n  ser&aacute;n  atributos de la Comisi&oacute;n Organizadora.</p><p>La presentaci&oacute;n de  las  ponencias significa el conocimiento y aceptaci&oacute;n de estas   Instrucciones.</p><p>Es condici&oacute;n inexcusable para la aceptaci&oacute;n de los   trabajos el previo pago de la inscripci&oacute;n a la Jornada de al menos uno   de los autores de la ponencia respectiva.</p><p>Para la exposici&oacute;n de la ponencia en la Jornada, el ponente contar&aacute; con una notebook y ca&ntilde;on a su disposici&oacute;n, como para poder realizar una presentaci&oacute;n PowePoint.</p>',
  ),
