    'es_ES' => '<p>Para inscribirse en la Jornada, debe registrarse en este sitio: <a href="/index.php/JNDC/III/schedConf/registration">REGISTRO</a> y luego completar la inscripci&oacute;n abonando el monto correspondiente:</p><p>La inscripci&oacute;n como MIEMBRO ACTIVO tiene un costo de $130.</p><p>Formas de abonarlo:</p><p>1) En efectivo: en la sede de la Jornada, hasta el 27/8, inclusive.</p><p>2) Bancariamente:</p><p>&nbsp;&nbsp;&nbsp; Banco de la Naci&oacute;n Argentina</p><p>&nbsp;&nbsp;&nbsp; Caja de Ahorro en pesos N&ordm;: 301258708</p><p>&nbsp;&nbsp;&nbsp; CBU: 01100303-30003012587083</p><p>&nbsp;&nbsp;&nbsp; CUIT: 20-30078266-4</p><p>&nbsp;&nbsp;&nbsp; DNI: 30078266</p><p>&nbsp;&nbsp;&nbsp; a) Dep&oacute;sito en efectivo, hasta el 25/8, inclusive.</p><p>&nbsp;&nbsp;&nbsp; b) Otros valores, hasta el 23/8, inclusive.</p><p>&nbsp;&nbsp;&nbsp; Una vez abonado, debe enviarse una imagen .jpg del ticket escaneado a IIIJNDC@gmail.com, con los datos del incripto, para su correcta imputaci&oacute;n.</p><p>La inscripci&oacute;n como ASISTENTE (alumnos) tiene un costo de $15. Incluye material de la Jornada y certificado. Puede ser abonado en el Centro de Estudiantes de Ciencias Econ&oacute;micas (FCE&nbsp; 6 e 47 y 48) hasta el 26/8, en la sede de la Jornada el d&iacute;a 27/8 o sino bancariamente como es descrito m&aacute;s arriba.</p>',
